import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { formSchemaModal } from './modalSchema';

import { StyledTitle } from '../../../styles/typography'

export const TechModal = () => {
    const {
        register,
        handleSubmit,
        reset,
        formState: { errors },
      } = useForm({
        resolver: yupResolver(formSchemaModal),
      });


  return (
    <>

    <div>
        <StyledTitle fontSize="four" tag="h3">Cadastrar Tecnologias</StyledTitle>
        <button>X</button>
    </div>

    <form>
    <div>
          <label htmlFor="email">E-mail</label>
          <input
            type="email"
            id="email"
            placeholder="Digite o seu e-mail"
            {...register("email")}
          />
        </div>
    </form>
    </>
  )
}
